import './Netlix.css';

export default function Netflix() {
    return (
        <div>
        <div class="netflix">

        <div>Dark</div>
        <div>Breking bad</div>
        <div>Money heist</div>
        <div> Peaky blinders</div>

        </div>
            
        </div>
    )
}
